var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro progress bar test object.
 * @param {Object} [props] Initializes a UIAPro Progress Bar test object using the supplied property bag.
 * @returns {ProgressBar} the description object that was initialized.
 * @class ProgressBar
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function ProgressBar(props) {
    var progressBarDesc = new UiObjectBaseDescription("ProgressBar");

    progressBarDesc._defineByPropertyBag(props);
    return progressBarDesc;
}

/**
 * A UIAPro progress bar.
 * @constructor
 * @class ProgressBarTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function ProgressBarTO(session, description) {
    description = description || ProgressBar();
    var progressBarTO = new UiObjectBaseTO("UIAProProgressBar", session, description);

    return progressBarTO;
}

module.exports.ProgressBarTO = ProgressBarTO;
module.exports.ProgressBar = ProgressBar;